<p>–ü–æ—Å–ª–µ–¥–Ω–µ–µ –æ—Å–æ–±–µ–Ω–Ω–æ –≤–ø–µ—á–∞—Ç–ª—è–µ—Ç —Å—Ç–∞—Ä—à—É—é —Å–µ—Å—Ç—Ä—É –Ω–µ–≤–µ—Å—Ç—ã –°–∞—Ä—É, –∏ –≤–æ—Ç —É–∂–µ –¥–µ–≤—É—à–∫–∞ –æ–∫–∞–∑—ã–≤–∞–µ—Ç—Å—è —Å –ù–∞–π–ª–∑–æ–º –Ω–∞–µ–¥–∏–Ω–µ –ø–æ–¥ –∑–≤—ë–∑–¥–Ω—ã–º –Ω–µ–±–æ–º. –°—Ü–µ–Ω–∞—Ä–∏—Å—Ç—É –ï–Ω–¥—ñ –°—ñ–∞—Ä—ñ, —è–∫–∏–π –Ω–∞–ø–∏—Å–∞–≤ —Ü–µ–π —Ñ—ñ–ª—å–º —â–µ –≤ —ñ–Ω—Å—Ç–∏—Ç—É—Ç—ñ, –≤–¥–∞–ª–æ—Å—è –∑—Ä–æ–±–∏—Ç–∏ —Ç–µ, —â–æ —Å–≤–æ–≥–æ —á–∞—Å—É —Ö–æ—Ç—ñ–≤ —É—Ç—ñ–ª–∏—Ç–∏ –≤ ¬´–î–Ω—ñ –±–∞–±–∞–∫–∞¬ª –î–µ–Ω–Ω—ñ –†—É–±—ñ–Ω. –°—Ç—Ä—ñ—á–∫—É –ø—Ä–µ–¥—Å—Ç–∞–≤–∏—Ç—å –∫—ñ–Ω–æ–∫—Ä–∏—Ç–∏–∫ —Ç–∞ –∞—Ä—Ç-–º–µ–Ω–µ–¥–∂–µ—Ä ¬´–ö–æ–ø–µ—Ä–Ω—ñ–∫–∞¬ª –°—Ç–∞–Ω—ñ—Å–ª–∞–≤ –¢–∞—Ä–∞—Å–µ–Ω–∫–æ. –ó–∞–º—ñ—Å—Ç—å —Ç–æ–≥–æ, —â–æ–± –æ–ø–∏—Ä–∞—Ç–∏—Å—è —Å–≤—ñ—Ç—É, —Ç—Ä–µ–±–∞ –Ω–∞–≤—á–∏—Ç–∏—Å—è –∂–∏—Ç–∏ —Ä–∞–∑–æ–º —ñ–∑ –Ω–∏–º —Ç–∞ —Ü—ñ–Ω—É–≤–∞—Ç–∏ –≤—Å–µ, —â–æ –≤—ñ–Ω —Ç–æ–±—ñ –¥–∞—î. –ù–∞ –æ–¥–Ω–æ–º—É –ª—ñ—Ç–Ω—å–æ–º—É –≤–µ—Å—ñ–ª–ª—ñ –∑–Ω–∞–π–æ–º–ª—è—Ç—å—Å—è —Å–µ—Å—Ç—Ä–∞ –Ω–∞—Ä–µ—á–µ–Ω–æ—ó –°–∞—Ä–∞ —ñ —Ö–ª–æ–ø–µ—Ü—å –ø–æ–¥—Ä—É–∂–∫–∏ –Ω–∞—Ä–µ—á–µ–Ω–æ—ó –ù–∞–π–ª–∑.</p>
<p>–¢–∞–∫, –≤—ñ–¥–æ–º–æ, —â–æ —É —Ñ—ñ–ª—å–º—ñ "–•–∏–∂—ñ –ø—Ç–∞—à–∫–∏"¬†—Ä–æ–∑–±—ñ–π–Ω–∏—Ü—è –ì–∞—Ä–ª—ñ –ö–≤—ñ–Ω –±—É–¥–µ –ª—ñ–¥–µ—Ä–æ–º –∂—ñ–Ω–æ—á–æ—ó –∫–æ–º–∞–Ω–¥–∏ –ª–∏—Ö–æ–¥—ñ–π–æ–∫.</p><strong><a id='z3'></a><h2></h2></strong><p>–¢–µ–ø–µ—Ä –≥–µ—Ä–æ—ó–Ω—è –ª–∏—à–∏–ª–∞—Å—è —Å–∞–º–∞, –±–æ –î–∂–æ–∫–µ—Ä –∫–∏–Ω—É–≤ —ó—ó. –ü–µ—Ä—Å–æ–Ω–∞–∂, —â–æ –ø–æ —Å—É—Ç—ñ –≤–≤–∞–∂–∞—î—Ç—å—Å—è –æ–¥–Ω–∏–º –∑ –Ω–∞–π—Å–∏–ª—å–Ω—ñ—à–∏—Ö –±—ñ–π—Ü—ñ–≤ —É –≤—Å–µ—Å–≤—ñ—Ç—ñ DC, –Ω–∞–º –ø–æ–∫–∞–∑–∞–Ω–∏–π —è–∫ –±–µ–∑–≤–æ–ª—å–Ω–∞ —Å–ø—ñ–≤–∞—á–∫–∞ –∑ –∫–ª—É–±—É, —è–∫–∞ –±–æ—ó—Ç—å—Å—è –π —Å–ª–æ–≤–æ —Å–∫–∞–∑–∞—Ç–∏ —Å–≤–æ—î–º—É –±–æ—Å–æ–≤—ñ. –Ü –∑ –Ω–∏—Ö –≤–∏–π—à–æ–≤ –±–∏ –∫–ª–∞—Å–Ω–∏–π –¥—É–µ—Ç, —è–∫–æ–º—É –ø—Ä–æ—Å—Ç–æ –∑–∞–±—Ä–∞–∫–ª–æ –µ–∫—Ä–∞–Ω–Ω–æ–≥–æ —á–∞—Å—É, —Ç–æ–º—É —â–æ –π–æ–≥–æ –ø—Ä–∏–¥—ñ–ª—è–ª–∏ –∫—É–¥–∏ —è–∫ –º–µ–Ω—à —Ü—ñ–∫–∞–≤–∏–º –≥–µ—Ä–æ—è–º. –Ø–∫—â–æ —Ç–æ–±—ñ –Ω–µ–º–∞—î 18 —Ä–æ–∫—ñ–≤, —Ç–∏ –Ω–µ –∑–º–æ–∂–µ—à –ø–µ—Ä–µ–≥–ª—è–Ω—É—Ç–∏ —Ü–µ–π —Ñ—ñ–ª—å–º —É –∫—ñ–Ω–æ—Ç–µ–∞—Ç—Ä—ñ.</p>
<p>–á—Ö –≤–æ—Ä–æ–≥–æ–º –≤–∏—è–≤–ª—è—î—Ç—å—Å—è –∫–æ—Ä–æ–ª—å –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–≥–æ —Å–≤—ñ—Ç—É ‚Äî –Ω–µ–ø–æ—â–∞–¥–Ω–∏–π –†–æ–º–∞–Ω –°—ñ–æ–Ω—ñ—Å.</p><img src="https://image.isu.pub/130828140634-10010f6285f2dac76bb10fbccf7412da/jpg/page_1.jpg" alt="Search form" style="max-width: 480px; max-height: 480px;"/><p>–û–ø–∏—Ç–∞–Ω—ñ –≤–∏–¥–∞–Ω–Ω—è–º –µ–∫—Å–ø–µ—Ä—Ç–∏ –Ω–∞–∑–≤–∞–ª–∏ –∫—ñ–ª—å–∫–∞ –ø—Ä–∏—á–∏–Ω —Ç–∞–∫–æ–≥–æ —Ä–µ–∑—É–ª—å—Ç–∞—Ç—É, –≤ —Ç–æ–º—É —á–∏—Å–ª—ñ –ø–æ–≥–∞–Ω–∏–π –º–∞—Ä–∫–µ—Ç–∏–Ω–≥ —ñ –Ω–µ–≤–∏—Ä–∞–∑–Ω—ñ —Ç—Ä–µ–π–ª–µ—Ä–∏. –î—ñ–≤—á–∞—Ç–∞ –æ–±'—î–¥–Ω—É—é—Ç—å—Å—è –≤ –æ–¥–Ω—É –∫–æ–º–∞–Ω–¥—É, —â–æ–± –≤—Ä—è—Ç—É–≤–∞—Ç–∏ –¥—ñ–≤—á–∏–Ω–∫—É –ö–∞—Å—Å–∞–Ω–¥—Ä—É –ö–µ–π–Ω –≤—ñ–¥ –∑–ª–æ–≥–æ –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–≥–æ –±–æ—Å–∞ ‚Äî –ß–æ—Ä–Ω–æ—ó –ú–∞—Å–∫–∏, —è–∫–æ–≥–æ –Ω–∞—Å–ø—Ä–∞–≤–¥—ñ –∑–≤–∞—Ç–∏ –†–æ–º–∞–Ω –°–∞–π–æ–Ω—ñ—Å. –°–∏–ª—å–Ω—ñ —Ç–∞ –≤—ñ–¥–≤–∞–∂–Ω—ñ –≥–µ—Ä–æ—ó–Ω—ñ –ø–æ–≤–∏–Ω–Ω—ñ –≤—Ä—è—Ç—É–≤–∞—Ç–∏ –º–∞–ª–µ–Ω—å–∫—É –¥—ñ–≤—á–∏–Ω–∫—É –≤—ñ–¥ —Ä—É–∫ –Ω–µ–±–µ–∑–ø–µ—á–Ω–æ–≥–æ –ª–∏—Ö–æ–¥—ñ—è.</p>
		
	<p>–ó–∞ —Å—é–∂–µ—Ç–æ–º, –•–∞—Ä–ª—ñ –ö–≤—ñ–Ω —Ä–æ–∑—Ä–∏–≤–∞—î —Å—Ç–æ—Å—É–Ω–∫–∏ –∑ –î–∂–æ–∫–µ—Ä–æ–º —Ç–∞ –Ω–∞–º–∞–≥–∞—î—Ç—å—Å—è –±—É–¥—É–≤–∞—Ç–∏ —Å–∞–º–æ—Å—Ç—ñ–π–Ω–µ –∂–∏—Ç—Ç—è. –î—ñ–≤—á–∞—Ç–∞ –±—É–¥—É—Ç—å –ø—Ä–æ—Ç–∏—Å—Ç–æ—è—Ç–∏ –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–º—É –∞–≤—Ç–æ—Ä–∏—Ç–µ—Ç—É —ñ –±—ñ–∑–Ω–µ—Å–º–µ–Ω–æ–≤—ñ –†–æ–º–∞–Ω—É –°—ñ–æ–Ω—ñ—Å—É. –í–æ–Ω–∞ —Ö–∞—Ä–∏–∑–º–∞—Ç–∏—á–Ω–∞, –≥—Ä–∞–π–ª–∏–≤–∞, –ø–æ–∑–±–∞–≤–ª–µ–Ω–∞ –≥–∞–ª—å–º —ñ —ó–π –≤–¥–∞—î—Ç—å—Å—è —É –±—É–¥—å-—è–∫—É –µ–º–æ—Ü—ñ—é –ø—ñ–¥–º—ñ—à–∞—Ç–∏ –Ω–æ—Ç–∫–∏ —Ñ—ñ—Ä–º–æ–≤–æ–≥–æ —à–∞–ª–µ–Ω—Å—Ç–≤–∞ –ø–µ—Ä—Å–æ–Ω–∞–∂–∞. –í –§–∏–ª—å–º–µ –•–∏—â–Ω—ã—Ö –ø—Ç–∏—Ü—ã –µ—â–µ –±–æ–ª—å—à–µ —Ä–∞—Å–∫—Ä—ã–≤–∞–µ—Ç—Å—è –æ–±—Ä–∞–∑ –•–∞—Ä–ª–∏ –ö–≤–∏–Ω–Ω, —ç—Ç–æ –µ—ë –∫–æ–∫–µ—Ç—Å—Ç–≤–æ, –±–ª–µ—Å—Ç–∫–∏, –ª–∞–∫, –µ—ë —Å–∏–ª—å–Ω–∞—è —Ö–∞—Ä–∏–∑–º–∞, –∫–æ—Ç–æ—Ä–∞—è –∑–∞—Å—Ç–∞–≤–∏—Ç –∑—Ä–∏—Ç–µ–ª—è –ø–æ–ª—é–±–∏—Ç—å –•–∞—Ä–ª–∏, –Ω–µ—Å–º–æ—Ç—Ä—è, —á—Ç–æ –æ–Ω–∞ –∞–Ω—Ç–∏–≥–µ—Ä–æ–π.</p>
<p>–§—ñ–ª—å–º-–Ω–æ–º—ñ–Ω–∞–Ω—Ç –Ω–∞ –ø—Ä–µ–º—ñ—é –û—Å–∫–∞—Ä —É –∫–∞—Ç–µ–≥–æ—Ä—ñ—ó "–ù–∞–π–∫—Ä–∞—â–∏–π —Ñ—ñ–ª—å–º" —Ä–æ–∑–ø–æ–≤—ñ–¥–∞—î –ø—Ä–æ –ø–æ–¥—ñ—ó, —â–æ –≤—ñ–¥–±—É–≤–∞—é—Ç—å—Å—è —É –ù—ñ–º–µ—á—á–∏–Ω—ñ –Ω–∞–ø—Ä–∏–∫—ñ–Ω—Ü—ñ –î—Ä—É–≥–æ—ó —Å–≤—ñ—Ç–æ–≤–æ—ó –≤—ñ–π–Ω–∏.</p>
</p>
